import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import Navbar from './components/Navbar';

class App extends Component {
    render() {
        return (
            <div className="App">
                <header className="App-header">
                    Welcome to Milo!
                </header>
            </div>
        );
    }
}

export default App;
